import { toBeInTheDocument } from '@testing-library/jest-dom/dist/matchers';
import { RecipeCard } from './RecipesCard';

export const RecipeList = ({ items }) => {
  return (
    <ul>
      {items.map(item => (
        <li key={item.id}>
          <RecipeCard item={item} />
        </li>
      ))}
    </ul>
  );
};
